import React from "react";
import Navbar from "./components/Navbar";
import { Route, Routes } from "react-router";
import Livegames from "./pages/Livegames";
import Teams from "./pages/Teams";
import Leagues from "./pages/Leagues";
import Transfers from "./pages/Transfers";
import MainLeagueComponent from "./leagues/MainLeagueComponent";
import Brasileiro from "./leagues/Brasileiro";
import Drugabundesliga from "./leagues/Drugabundesliga";
import Eredivise from "./leagues/Eredivise";
import Hnl from "./leagues/Hnl";
import Jupiler from "./leagues/Jupiler";
import Laliga from "./leagues/Laliga";
import Ligaportugal from "./leagues/Ligaportugal";
import Ligue1 from "./leagues/Ligue1";
import Ljeva from "./leagues/Ljeva";
import Mls from "./leagues/Mls";
import Russianprem from "./leagues/Russianprem";
import Scottish from "./leagues/Scottish";
import Seriaa from "./leagues/Seriaa";
import { useState } from "react";
import Bundesliga from "./leagues/Bundesliga";

const App = () => {
  const [data, setData] = useState("");
  const handleUpdate = (updatedData) => {
    setData(updatedData);
  };
  console.log(data);
  return (
    <>
      <div className="flex">
        <Navbar />
        <Routes>
          <Route exact path="/teams" element={<Teams />}></Route>
          <Route exact path="/transfers" element={<Transfers />}></Route>
          <Route
            exact
            path="/"
            element={<Leagues data={data} handleUpdate={handleUpdate} />}
          ></Route>

          <Route exact path="/livegames" element={<Livegames />}></Route>
          <Route
            exact
            path="/leagues/premier"
            element={<MainLeagueComponent apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/laliga"
            element={<Laliga apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/bundesliga"
            element={<Bundesliga apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/seriea"
            element={<Seriaa apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/ligue1"
            element={<Ligue1 apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/russianpremier"
            element={<Russianprem apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/primeira"
            element={<Ligaportugal apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/eredivisie"
            element={<Eredivise apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/jupilerproleague"
            element={<Jupiler apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/brasileirao"
            element={<Brasileiro apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/mls"
            element={<Mls apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/ligamx"
            element={<Ljeva apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/spfl"
            element={<Scottish apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/secondbundesliga"
            element={<Drugabundesliga apiTitle={data} />}
          ></Route>
          <Route
            exact
            path="/leagues/prvaliga"
            element={<Hnl apiTitle={data} />}
          ></Route>
        </Routes>
      </div>
    </>
  );
};

export default App;
